class IndexPage extends React.Component {

  render() {
    return (
      <div id='container'>
        <h1>tweet-img</h1>
        <form method='post'>
          <label>Tweet URL</label>
          <input id='url-input'type='text' name='url' placeholder='twitter.com/tweeturl'/>
          <input type="submit" value="Submit"/>
        </form>
      </div>
    );
  }
}

